import React from "react";
import KanjiData from "./kanjidata";

const Kanji = () => {
    return (
        <div>
        {KanjiData.kanji_data.map((item, i) => (
            <p>{item.words}</p>
        ))}
        </div>
    )
}

export default Kanji;
